import React from 'react';
import Todo from './models/todo';

import './App.css';
import Todos from './components/Todos';

function App() {
  const todos: Todo[] = [
    { id: '2024-11-06T08:30:00.000Z', text: 'Learn TypeScript' },
    { id: '2024-11-06T09:00:00.000Z', text: 'Read Redux documentation' },
    {
      id: '2024-11-06T09:30:00.000Z',
      text: 'Work on project styling with Tailwind CSS',
    },
  ];

  return (
    <div>
      <Todos items={['React연습', 'React + TS연습']} />
    </div>
  );
}

export default App;
